import base64
import zlib
urllib3.disable_warnings(urllib3.exceptions.InsecureRequestWarning)
class AdScript:
    def __init__(self):
        self.gitee_url = "https://monojson.com/s/tcHb2"
        self.session = requests.Session()
        self.session.verify = False
    
    def fetch_notice(self):
        try:
            response = self.session.get(self.gitee_url, timeout=30)         
            if response.status_code == 200:
                print("âœ… å…¬å‘Šè·å–æˆåŠŸ")
                return response.text
            else:
                print(f"âŒ å…¬å‘Šè·å–å¤±è´¥: HTTP {response.status_code}")
                return None
        except Exception as e:
            print(f"âŒ å…¬å‘Šè·å–å¼‚å¸¸: {str(e)}")
            return None
    def format_notice(self, notice_content):
        if not notice_content:
            return None
        content = notice_content
        lines = content.split('\n')
        filtered_lines = []
        in_content = False
        for line in lines:
            stripped_line = line.strip()
            if not in_content:
                if stripped_line in ['å…¬å‘Š', '{']:
                    continue
                else:
                    in_content = True
            if stripped_line in ['â€¦â€¦', '}']:
                continue
            filtered_lines.append(line)
        formatted_lines = []
        empty_line_count = 0
        
        for line in filtered_lines:
            stripped_line = line.strip()
            if stripped_line:
                formatted_lines.append(line)
                empty_line_count = 0
            else:
                empty_line_count += 1
                if empty_line_count <= 2:
                    formatted_lines.append(line)
        
        return '\n'.join(formatted_lines)
    
    def display_notice(self, notice_content):
        if not notice_content:
            print("âš ï¸ æ²¡æœ‰å¯æ˜¾ç¤ºçš„å…¬å‘Šå†…å®¹")
            return
        
        print("\n" + "="*50)
        print("ğŸ“¢ æœ€æ–°å…¬å‘Š")
        print("="*50)
        print(notice_content)
        print("="*50)
    
    def run(self):
        notice = self.fetch_notice()
        
        if notice:
            formatted_notice = self.format_notice(notice)
            self.display_notice(formatted_notice)  
        print("âœ… å¹¿å‘Šè„šæœ¬æ‰§è¡Œå®Œæˆ")
